const concat = (x, y) => x.concat(y);

// eslint-disable-next-line no-extend-native,func-names
Array.prototype.flatMap = function (f) {
  return this.map(f).reduce(concat, []);
};

export default class PrimitiveCalculatorParser {
  constructor(rawText) {
    this.rawText = rawText;
  }

  run() {
    const lines = this.rawText.split(/\n/);
    const that = this;
    log.debug('[PrimitiveCalculatorParser] start parsing.');
    const result = lines.map((line) => {
      log.debug(`[PrimitiveCalculatorParser] found line: '${line}'`);
      const tokens = new Array(linestart);
      if (line.trim() !== '') {
        const parts = line.trim().split(' ');
        for (let i = 0; i < parts.length; i += 1) {
          const part = parts[i];
          log.trace(`[PrimitiveCalculatorParser] found line part: '${part}'`);
          if (that.isWildcard(part)) {
            log.trace('[PrimitiveCalculatorParser] part is wildcard');
            tokens.push(wildcard);
          } else if (that.hasOperator(part)) {
            log.trace('[PrimitiveCalculatorParser] part is operator');
            tokens.push(new Operator(part[0]));
            if (part.length > 1) {
              parts[i] = part.slice(1, part.length);
              i -= 1;
            }
          } else if (that.isComment(part)) {
            log.trace('[PrimitiveCalculatorParser] part is comment');
            tokens.push(commentstart);
            if (part.length > 1) {
              tokens.push(
                new Text(part.slice(1, part.length))
              );
            }
          } else if (that.isLongCount(part)) {
            log.trace('[PrimitiveCalculatorParser] part is long-count');
            tokens.push(
              new mayadates.factory.LongCountFactory().parse(part)
            );
          } else if (that.isNumeric(part)) {
            log.trace('[PrimitiveCalculatorParser] part is numeric');
            tokens.push(new Numeric(part));
          } else if (that.isWord(part)) {
            log.trace('[PrimitiveCalculatorParser] part is word');
            tokens.push(new Text(part));
          } else {
            log.error('[PrimitiveCalculatorParser] could not determine type');
            throw new Error(`Unexpected token found (${part}) in line (${line})`);
          }
        }
      }
      tokens.push(lineend);
      return tokens;
    }).flatMap((t) => t);
    log.debug('[PrimitiveCalculatorParser] finish parsing.');
    return result;
  }

  isWildcard(part) {
    return part === '*';
  }

  isComment(part) {
    return part[0] === '#';
  }

  isNumeric(part) {
    return /^[\d*.]+$/.test(part);
  }

  isLongCount(part) {
    return this.isNumeric(part) && part.includes('.');
  }

  isWord(part) {
    return /^[*()\w\d.']+$/.test(part);
  }

  hasOperator(part) {
    return ['+', '-'].includes(part[0]);
  }
}

import mayaDate from '@drewsonne/maya-dates';
import Numeric from './tokens/numeric';
import Text from './tokens/text';


const FOUR_PART = 0;
const THREE_PART_BIG_ENDIAN = 1;
const THREE_PART_LITTLE_ENDIAN = 2;
const TWO_PART = 4;


export default class CalendarRoundParser {
  /**
   *
   * @param parts {TokenBase[]}
   */
  constructor(...parts) {
    this.parts = parts;
  }

  get length() {
    return this.parts.length;
  }

  toString() {
    return `${this.parts.join(' ')}`;
  }

  /**
   *
   * @return {CalendarRound|undefined}
   */
  run() {
    const crType = this.isValid();
    if (crType === undefined) {
      return undefined;
    }
    const factory = new mayaDate.factory.CalendarRoundFactory();
    const dateString = this.toString();
    let cr;
    try {
      cr = factory.parse(dateString);
    } catch (err) {
      cr = null;
    }
    return cr;
  }

  isValid() {
    if (this.length === 4) {
      if (this.isFourPart()) {
        return FOUR_PART;
      }
    } else if (this.length === 3) {
      if (this.isThreePartBigEndian()) {
        return THREE_PART_BIG_ENDIAN;
      }
      if (this.isThreePartLittleEndian()) {
        return THREE_PART_LITTLE_ENDIAN;
      }
    } else if (this.length === 2) {
      if (this.isTwoPart()) {
        return TWO_PART;
      }
    }
    return undefined;
  }


  isFourPart() {
    const numParts = this.parts.length;
    if (
      !(this.parts[0] instanceof Numeric)
      || !(this.parts[2] instanceof Numeric)
    ) {
      return false;
    }
    if (
      !(this.parts[1] instanceof Text)
      || !(this.parts[3] instanceof Text)
    ) {
      return false;
    }
    const validCoefficients = this.parts[0].isCoeff()
      && !this.parts[1].isCoeff()
      && this.parts[2].isCoeff()
      && !this.parts[3].isCoeff();

    return validCoefficients && (numParts === 4);
  }

  isThreePart() {
    return this.parts.length === 3;
  }

  isThreePartBigEndian() {
    return (
      (this.parts[0] instanceof Text)
      && (this.parts[1] instanceof Numeric)
      && (this.parts[2] instanceof Text)
    );
  }

  isThreePartLittleEndian() {
    return (
      (this.parts[0] instanceof Numeric)
      && (this.parts[1] instanceof Text)
      && (this.parts[2] instanceof Text)
    );
  }

  isTwoPart() {
    return (
      (this.parts[0] instanceof Text)
      && (this.parts[1] instanceof Text)
    );
  }
}

import log from 'loglevel'
import CalendarRoundParser from './calendar-round-parser';
import Windowing from './windowing';

export default class CalendarRoundWindowing extends Windowing {
  run() {
    if (this.parts.length < 3) {
      return null;
    }
    const windowGenerator = this.windows(2, 4);
    let windows = windowGenerator.next();
    log.trace('[CalendarRoundWindowing] start scalling for calendar rounds');
    while (!windows.done) {
      windows = windows.value;
      for (let j = 0; j < windows.length; j += 1) {
        const window = windows[j];
        const a = new CalendarRoundParser(...window).run();
        if (a !== null && a !== undefined) {
          log.trace(`[CalendarRoundWindowing] finished scanning and found calendar round: '${a}' at location ${j} for length ${window.length}`);
          return [
            j,
            a,
            window.length
          ];
        }
      }
      windows = windowGenerator.next();
    }
    log.trace('[CalendarRoundWindowing] finish scanning and found no calendar rounds');
    return null;
  }
}

