  run() {
    const crwindow = new CalendarRoundWindowing(this.lineParts).run();
    if (crwindow !== null) {
      let [start, element, length] = crwindow;
      if (start !== 0) {
        return null;
      }
      const potentialLC = this.lineParts[start + length];
      let lc;
      if (TypeChecker.isNumeric(potentialLC)) {
        if (potentialLC.isLongCount()) {
          lc = new mayadates.factory.LongCountFactory().parse(`${potentialLC}`);
        }
      } else if (TypeChecker.isLongCount(potentialLC)) {
        lc = potentialLC;
      }
      if (lc !== undefined) {
        length += 1;
        return new mayadates.FullDate(element, lc);
      }
    }
    return null;
  }

  // eslint-disable-next-line class-methods-use-this
  replace(elements, start, element, length) {
